import React from 'react';


const MainContent = (props) => {

	return (
		<main className='container'>
			<ul className='list-group'>
			{
				props.todoItems.map((todo, key) =>
					<li key={todo.id} className='list-group-item form-group'>
						<div className='checkbox'>
							<input type='checkbox' onChange={handleChange} name='check'  checked={todo.completed} />
							<label className=''> {todo.title} </label>
						</div>
					</li>
				)
			}
			</ul>
		</main>
	)	
}

const handleChange = () => {
	console.log("Just Changed The State Of the Checkbox")
}

export default MainContent;
